//加载背景
var imgBg 		= "data:image/png;base64,";
var imgBarBg 	= "data:image/png;base64,";
var imgBar 		= "data:image/png;base64,";

/**
 * <p>cc.LoaderScene is a scene that you can load it when you loading files</p>
 * <p>cc.LoaderScene can present thedownload progress </p>
 * @class
 * @extends cc.Scene
 * @example
 * var lc = new cc.LoaderScene();
 */
LoadingScene = cc.Scene.extend({

	barBgSpr	:	null,
	loadingBar	:	null,

	_interval : null,
	_label : null,
	_className:"LoaderScene",
	cb: null,
	target: null,
	/**
	 * Contructor of cc.LoaderScene
	 * @returns {boolean}
	 */
	init : function(){

		Wsize = cc.director.getWinSize();

		var self = this;

		//logo
		var logoWidth = 160;
		var logoHeight = 200;

		// bg
		var bgLayer = self._bgLayer = new cc.LayerColor(cc.color(32, 32, 32, 255));
		self.addChild(bgLayer, 0);

		//image move to CCSceneFile.js
		var fontSize = 24, lblHeight =  -logoHeight / 2 + 100;

		//背景
		if(imgBg){
			//loading logo
			cc.loader.loadImg(imgBg, {isCrossOrigin : false }, function(err, img){
				logoWidth = img.width;
				logoHeight = img.height;
				self._initStage(img, cc.visibleRect.center);
			});
			fontSize = 14;
			lblHeight = -logoHeight / 2 - 10;
		}
		//loading percent
		var label = self._label = new cc.LabelTTF("资源加载中... 0%", "Arial", fontSize);
		label.setPosition(cc.pAdd(cc.visibleRect.center, cc.p(0, lblHeight)));
		label.setColor(cc.color(180, 180, 180));
		bgLayer.addChild(this._label, 10);

		//进度条背景
		if (imgBarBg) {
			cc.loader.loadImg(imgBarBg, {isCrossOrigin : false}, function (err, img) {
				var texture = new cc.Texture2D();
				texture.initWithElement(img);
				texture.handleLoadedTexture();

				barBgSpr = new cc.Sprite(texture);
				barBgSpr.setPosition(label.getPositionX(), label.getPositionY() - 30);
				barBgSpr.setAnchorPoint(0.5, 0.5);
				self.addChild(barBgSpr);

				barBgSpr.setScale(0.5);
			});
		}

		//进度条
		if (imgBar) {
			cc.loader.loadImg(imgBar, {isCrossOrigin : false}, function (err, img) {
				var texture = new cc.Texture2D();
				texture.initWithElement(img);
				texture.handleLoadedTexture();

				loadingBar = new cc.Sprite(texture);
				loadingBar.setPosition(0, barBgSpr.getContentSize().height/2 + 5);
				loadingBar.setAnchorPoint(0, 0.5);
				barBgSpr.addChild(loadingBar);
				loadingBar.setScaleX(0);
			});
		}

		return true;
	},

	_initStage: function (img, centerPos) {
		var self = this;
		var texture2d = self._texture2d = new cc.Texture2D();
		texture2d.initWithElement(img);
		texture2d.handleLoadedTexture();
		var logo = self._logo = new cc.Sprite(texture2d);
		logo.setScale(0.5);
		logo.x = centerPos.x;
		logo.y = centerPos.y;
		self._bgLayer.addChild(logo, 10);
	},
	/**
	 * custom onEnter
	 */
	onEnter: function () {
		var self = this;
		cc.Node.prototype.onEnter.call(self);
		self.schedule(self._startLoading, 0.3);
	},
	/**
	 * custom onExit
	 */
	onExit: function () {
		cc.Node.prototype.onExit.call(this);
		var tmpStr = "Loading... 0%";
		this._label.setString(tmpStr);
	},

	/**
	 * init with resources
	 * @param {Array} resources
	 * @param {Function|String} cb
	 * @param {Object} target
	 */
	initWithResources: function (resources, cb, target) {
		if(cc.isString(resources))
			resources = [resources];
		this.resources = resources || [];
		this.cb = cb;
		this.target = target;
	},

	_startLoading: function () {
		var self = this;
		self.unschedule(self._startLoading);
		var res = self.resources;
		cc.loader.load(res,
			function (result, count, loadedCount) {
				//cc.log(loadedCount + " / " + count);
				var percent = (loadedCount / count * 100) | 0;
				percent = Math.min(percent, 100);
				self._label.setString("资源加载中... " + percent + "%");

				//更新loadingBar
				loadingBar.setScaleX(percent/100);

			}, function () {
				if (self.cb)
					self.cb.call(self.target);
			});
	},

	_updateTransform: function(){
		this._renderCmd.setDirtyFlag(cc.Node._dirtyFlags.transformDirty);
		this._bgLayer._renderCmd.setDirtyFlag(cc.Node._dirtyFlags.transformDirty);
		this._label._renderCmd.setDirtyFlag(cc.Node._dirtyFlags.transformDirty);
		this._logo._renderCmd.setDirtyFlag(cc.Node._dirtyFlags.transformDirty);
	}
});
/**
 * <p>cc.LoaderScene.preload can present a loaderScene with download progress.</p>
 * <p>when all the resource are downloaded it will invoke call function</p>
 * @param resources
 * @param cb
 * @param target
 * @returns {cc.LoaderScene|*}
 * @example
 * //Example
 * cc.LoaderScene.preload(g_resources, function () {
        cc.director.runScene(new HelloWorldScene());
    }, this);
 */
LoadingScene.preload = function(resources, cb, target){
	var _cc = cc;
	if(!_cc.loaderScene) {
		_cc.loaderScene = new LoadingScene();
		_cc.loaderScene.init();
		cc.eventManager.addCustomListener(cc.Director.EVENT_PROJECTION_CHANGED, function(){
			_cc.loaderScene._updateTransform();
		});
	}
	_cc.loaderScene.initWithResources(resources, cb, target);

	cc.director.runScene(_cc.loaderScene);
	return _cc.loaderScene;
};